import React from 'react';

function AgentSidebar({ activeView, setActiveView }) {
  return (
    <div className="fixed top-0 left-0 h-full w-64 bg-green-900 text-white p-6 font-poppins">
      <h2 className="text-2xl font-bold mb-8">Agent Menu</h2>
      <nav className="flex flex-col space-y-4">
        <button
          onClick={() => setActiveView('view')}
          className={`text-left px-3 py-2 rounded ${activeView === 'view' ? 'bg-green-700' : 'hover:bg-green-700'}`}
        >
          View Tickets
        </button>
        <button
          onClick={() => setActiveView('profile')}
          className={`text-left px-3 py-2 rounded ${activeView === 'profile' ? 'bg-green-700' : 'hover:bg-green-700'}`}
        >
          Profile
        </button>
        <button
          onClick={() => setActiveView('view-users')}
          className={`text-left px-3 py-2 rounded ${activeView === 'view-users' ? 'bg-green-700' : 'hover:bg-green-700'}`}
        >
          View Users
        </button>
      </nav>
    </div>
  );
}

export default AgentSidebar;
